    useEffect(() => {
        setTimeout(() => {
            setSpinner(false);
        }, 1400);
    },[])

  return (
    spinner ? <Spinner/> :
    <div className='contact'>    
        <h2 className='about-subtitle'>
            <span className='green'> &lt;h1&gt; </span>  Contact me !<span className='green'> &lt;/h1&gt; </span>
        </h2>
    </div>

  )
}


export default Contact;
